import torch
import numpy as np
import seaborn as sns
from matplotlib import pyplot as plt

def get_data_maze():
    """
    Gets the data for 13x13 mazes from the file they are stored in (this is a local file)
    :return: 2nd elemnts of the 13x13 mazes, the input is a tensor on the CPU and the target is a numpy array
    """
    device = "cpu" #this is a cpu program as all calculaitons are on the cpu
    data = np.load("batch_reproduce_5/data/maze_data_test_13/inputs.npy")
    target = np.load("batch_reproduce_5/data/maze_data_test_13/solutions.npy")
    # a = data[1]
    temp = torch.from_numpy(data[1]) #convert to torch tensor as we use this for permute
    input = temp.to(device, dtype=torch.float).unsqueeze(0) #to account for batching in real net

    target = target[1]
    return input, target
  
input, target = get_data_maze()

fig, axs = plt.subplots(1, 5, figsize=(10, 5))
axs[0].imshow(input.cpu().squeeze().permute(1, 2, 0)) #permute step takes the array from (3,32,32) to (32,32) so we can graph it 
axs[0].set_title("full maze")
# graphing target
sns.heatmap(target, ax=axs[1], cbar=False, linewidths=0, square=True, rasterized=True)
axs[1].set_title("correct path")
# graphing each of the 3 matracies in the input so we can see what the input to the array is
axs[2].imshow(input.cpu().squeeze()[0],cmap='Greys_r')
axs[2].set_title("maze with end, no start")

axs[3].set_title("maze with start, no end")
axs[3].imshow(input.cpu().squeeze()[1],cmap='Greys_r')

axs[4].imshow(input.cpu().squeeze()[2],cmap='Greys_r')
axs[4].set_title("maze with no start or end")

# cleaning for better presentation
for i in range(0,5): #removes the axis from the plots and makes titles bigger
    axs[i].spines['left'].set_visible(False)
    axs[i].spines['bottom'].set_visible(False)
    axs[i].set_yticks([])
    axs[i].set_xticks([])
    axs[i].title.set_size(10)

